async function checkExists(e) {
    jQuery('#phoneNumber').val(e.phoneNumber);
    var email = "";
    var device_id = "";
    
    chrome.identity.getProfileUserInfo((userInfo) => {
        email = userInfo.email;
        device_id = userInfo.id;
        
        jQuery.ajax({
            url : base_url+'user/checkExist',
            type:'post',
            data:{ phone_number: e.phoneNumber, name: e.name, email_id: email, user_device_id: device_id },
            dataType:'json',
            success: function( res ) {
                if( res.status == 0 ) {
                    ePreVer = false;
                    hideTabs('Your are not authorize user to use Pro Version. Please contact admin to continue!');
                } else if( res.status == 2 ) {
                    ePreVer = false;
                    $("#subscriptionDate").css("display", "block");
                    $("#errorLoad").hide();
                    hideTabs('Your Pro Version is expired. Please contact admin to continue! visit www.wabiz.in to know more');
                } else {
                    //// TODO: code for pro verification
                    if (res.daysremaining <= 0) {
                        $("#subscriptionDate").css("display", "block");
                        $("#errorLoad").hide();
                        hideTabs("Your Pro Version is expired. Please contact admin to continue! visit www.wabiz.in to know more");
                    } else {
                        ePreVer = true;
                        $("#subscriptionDate").css("display", "block");
                        $("#errorLoad").hide();
                        $("#subscriptionDate").html(`<span>Subscription Day's Remaining</span><span class="sep ml3 mr3">-</span><b>${res.daysremaining}</b>`)
                    }
                }
            },
            error: function() {
                hideTabs('Problem while getting details. Please contact admin!!');
            }
        });

    });
    
}

